import React, { Component } from 'react';
import './style.css';

export default class Gallery extends Component {
    image_url=this.state.images.url;
    constructor(){
        super();
        this.state={
            isLoaded: false,
            images : []
        }
    }

    componentDidMount(){

        fetch('https://api.imgflip.com/get_memes')
        .then(res => res.json())
        .then(json => {
            this.setState({
                isLoaded:true,
                images: json.data.memes 
            })
        })
    }
    renderImage(image_url){
        return(
            <div>
                <img src={image_url} />
            </div>
        );
    }
    render() {
        console.log(this.state.images[0])
        return (
            <div className="image_display">

            </div>
        );
    }
}

Gallery.propTypes = {
    imageUrls: React.PropTypes.arrayOf(React.propTypes.string).isRequired
};
